import * as be from "../routes/backendUrls";

const fakeServer = (api) => {
    console.log(be);
    switch (api) {
        case be.products:
            console.log("ok", be.products)
            break;

        default:
            console.log('worse');
            break;
    }
};

export default fakeServer;
